import React from 'react'

function data() {

    const getpokemon=async()=>{
        const response= await fetch("https://pokeapi.co/api/v2/pokemon/")
        const data= await response.json(); 
        var pokemonData= [...data.results];
    }
    useEffect(()=>{
        getpokemon();
    },[])
    
}
export default pokemonData
